from collections import namedtuple
import testcase

case = namedtuple("Testcase", ["Input", "Output"])


class Testcase(testcase.Testcase):
	def __init__(self):
		self.testcases = []
		self.testcases.append(case(Input=['aabbccdd', 7], Output=5))
		self.testcases.append(case(Input=['aabbccdd', 8], Output=1))
		self.testcases.append(case(Input=['aaabbb', 3], Output=8))
		self.testcases.append(case(Input=["abcd", 4], Output=1))
		self.testcases.append(case(Input=["",1924], Output=756148912))
		self.testcases.append(case(Input=["",1560], Output=591395664))

	def get_testcases(self):
		return self.testcases
